import HighchartsReact from "highcharts-react-official";
import Highcharts from "highcharts";
import { useCallback, useEffect, useState } from "react";
import DataProvider from "../services/DataProvider";

const SerbiaData = () => {
  const [data, setData] = useState([]);
  const [chartOptions, setChartOptions] = useState({});
  const buttons = [
    { value: "Female", key: "FMLE" },
    { value: "Male", key: "MLE" },
    { value: "Both Genders", key: "BTSX" },
    { value: "Compare", key: "CMP" },
  ];

  //TODO reformat to avoid boilerplate
  const dataFilter = (gender) => {
    let options = {
      title: { text: "Blood Pressure index for Serbia population" },
    };
    let series;
    if (gender.key !== "CMP") {
      series = data
        .filter(({ Dim1 }) => Dim1 === gender.key)
        .map(({ TimeDimensionValue, NumericValue }) => [
          parseInt(TimeDimensionValue),
          NumericValue,
        ])
        .sort((a, b) => {
          return a[0] - b[0];
        });
      options = {
        ...options,
        chart: {},
        series: { name: gender.value, data: series },
      };

      setChartOptions(options);
    } else return null;
  };

  const memorizedFilterData = useCallback(() => {
    dataFilter(data);
  }, [dataFilter, data]);

  // const defineComparisonChart = () => {
  //   let options = {
  //     title: { text: "Blood Pressure index comparison for Serbia population" },
  //   };
  //   let series = [];
  //   const maleData = data
  //     .filter(({ Dim1 }) => Dim1 === "MLE")
  //     .map(({ TimeDimensionValue, NumericValue }) => [
  //       parseInt(TimeDimensionValue * -1),
  //       NumericValue,
  //     ])
  //     .sort((a, b) => {
  //       return a[0] - b[0];
  //     });
  // };

  useEffect(() => {
    const getData = async () => {
      const data = await DataProvider.getSerbiaData();
      setData(data);

      dataFilter(buttons[0]);
    };
    getData();
  }, [memorizedFilterData, buttons]);
  return (
    <div>
      <h2>Serbia Graph here</h2>
      {buttons.map((b) => {
        return (
          <button
            onClick={() => {
              dataFilter(b);
            }}
            key={b.key}
          >
            {b.value}
          </button>
        );
      })}
      <HighchartsReact highcharts={Highcharts} options={chartOptions} />
    </div>
  );
};

export default SerbiaData;
